@Override
public boolean equals(Object o) {
  if (this == o) return true;
  if (o == null || getClass() != o.getClass()) return false;
  DocAndScore result = (DocAndScore) o;
  return docID == result.docID &&
      Float.compare(result.score, score) == 0;
}

